cc._loaderImage = "data:image/png;base64,";

var g_polyWidth = false;
var polyWidth;
var polyHeight;
cc.game.onStart = function(){
	if(!cc.sys.isNative && document.getElementById("cocosLoading")) //If referenced loading.js, please remove it
		document.body.removeChild(document.getElementById("cocosLoading"));

	// Pass true to enable retina display, disabled by default to improve performance
	cc.view.enableRetina(false);
	// Adjust viewport meta
	cc.view.adjustViewPort(true);
	// Setup the resolution policy and design resolution size
	polyWidth = new cc.ResolutionPolicy(cc.ContainerStrategy.EQUAL_TO_FRAME, cc.ContentStrategy.FIXED_WIDTH);
	polyHeight = new cc.ResolutionPolicy(cc.ContainerStrategy.EQUAL_TO_FRAME, cc.ContentStrategy.FIXED_HEIGHT);
	if(cc.view.getFrameSize().height/cc.view.getFrameSize().width>960/640)
		cc.view.setDesignResolutionSize(640, 960, polyWidth);//cc.ResolutionPolicy.SHOW_ALL);
	else
		cc.view.setDesignResolutionSize(640, 960, polyHeight);
	//cc.view.setDesignResolutionSize(640, 960,cc.ResolutionPolicy.SHOW_ALL);
	// The game will be resized when browser size change
	cc.view.resizeWithBrowserSize(true);
    //load resources
	LoadingLayer.preload(g_resources, function () {
        cc.director.runScene(new PlayScene());
    }, this);
	cc.view.setResizeCallback(function() {
		checkOrient();
	});
};
var orientTip = false;
var orientLayer = null;
function checkOrient(){
	//cc.log(cc.view.getFrameSize().height,cc.view.getFrameSize().width)
	if(cc.view.getFrameSize().height/cc.view.getFrameSize().width>960/640)
		cc.view.setDesignResolutionSize(640, 960, polyWidth);//cc.ResolutionPolicy.SHOW_ALL);
	else
		cc.view.setDesignResolutionSize(640, 960, polyHeight);
	if(!cc.sys.isMobile) return;
	var ww = cc.view.getFrameSize().width > cc.view.getFrameSize().height;

	var scene = cc.director.getRunningScene();
	if(!scene) return;
	if(ww){
		if(orientTip) return;
		orientTip = true;
		orientLayer = new cc.LayerColor(cc.color(200,200,200,255));
		scene.addChild(orientLayer,100);
		cc.log(scene)
		var label = new cc.LabelTTF("请旋转手机屏幕\n以达到最佳效果", "黑体", 80, cc.size(600, 400), cc.TEXT_ALIGNMENT_CENTER);
		label.setColor(cc.color(100,100,255));
		label.x = cc.winSize.width/2;
		label.y = cc.winSize.height/2;
		orientLayer.addChild(label);
	}
	else{
		if(!orientTip) return;
		orientTip = false;
		if(orientLayer!=null)
		{
			orientLayer.removeFromParent();
			orientLayer = null;
			//需要刷新。。。
			//cc.game.restart();
			//cc.director.runScene(new PlayScene());
		}
	}
}
cc.game.run();